import React from 'react'
import {TodoItem} from "./TodoItem";

export const Todos = (props) => {
  return (
    <div className="container">
      <h3>Todos list </h3>
       {props.todos.map((todo) => {
        return <TodoItem todo={todo} key={todo.sno} />;
      })}
    </div>
  )
}

export default Todos
